import "./Footer.scss";

const Footer = () => {
    return (
        <div>
            <div className="links">
                <div className="logo">Feyman</div>
                <div className="contact">
                    <h3>CONTACT</h3>
                    <span>P.NO. - +91 9649061610</span>
                    <span>Email - xnxxx</span>
                </div>
                <div className="quick-links"></div>
            </div>
            <div className="copyright"></div>
        </div>
    );
};

export default Footer;
